script: |
  super -f text -I q11111.spq | sort > q11111.out

inputs:
  - name: q11111.spq
    data: |
      SELECT DISTINCT + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + col1 ) BETWEEN col0 + + 80 AND ( - col1 * + 55 + col2 );
  - name: tab1

outputs:
  - name: q11111.out
    data: |
      3
